import './styles.scss';

function Login() {
  return (
    <div className='page-login'>
      <img src="/assets/library.png" alt="logo"/>

      <form className='page-login-form'>
        <input className='page-login-user'/>
        <input className='page-login-password'/>
        <button type='submint'>Login</button>
      </form>
    </div>
  );
}

export default Login;
